import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'ic-error-503',
  templateUrl: './ic-503.component.html',
  styles: [
    `
      .orange {
        color: #f0ad4e;
      }
    `,
  ],
})
export class Connect503Component implements OnInit {
  location: any;

  ngOnInit(): void {
    this.location = document.domain;
  }

  public tryAgain(): any {
    document.location.reload();
  }
}
<div class="text-center">
  <div>
    <div class="col-md-12">
      <span class="hipster img-fluid img-rounded"></span>
    </div>
    <div class="col-md-12">
      <!-- in bootstrap 4, glyphicons has been removed -->
      <h1><fa-icon icon="exclamation"></fa-icon> <span icTranslate="error.503"></span></h1>
      <p class="lead">
        <span icTranslate="error.503PageContent"></span
        ><em
          ><span>{{ location }}</span></em
        >.
      </p>
      <p><button type="button" class="btn btn-secondary" (click)="tryAgain()" icTranslate="error.tryAgainBtnText"></button></p>
    </div>
  </div>
</div>
